import React, { Component } from 'react';
import axios from 'axios'

class PostApi extends Component {
    state = { 
        firstName:'',
        lastName:'',
        surName:''
     }
    render() { 
        return ( 
            <div>
                <input name="firstName" onChange={this.onChangeHandler} type="text" placeholder="FirstName"></input>
                <input name="lastName" onChange={this.onChangeHandler} type="text" placeholder="LastName"></input>
                <input name="surName" onChange={this.onChangeHandler} type="text" placeholder="SurName"></input>
                <button>Submit</button>
            </div>
         );
    }
}

export default PostApi;
